    function downloadfun(value){
        $(document).ready(actual(value));
    }
    function actual(value) {
            $('#'+value).DataTable( {
                "dom": '<"dt-buttons"Bf><"clear">lirtp',
			"paging": false,
			"autoWidth": true,
            "searching": false,
            "ordering": false,
			"buttons": [ "excel","copy",
				{
					text: 'Download Report',
					extend: 'pdfHtml5',
					filename: 'Feedback Report',
					orientation: 'portrait',
					pageSize: 'A4', 
					exportOptions: {
						columns: ':visible'
					},
					customize: function (doc) {
						
						doc.content.splice(0,1);
						
						var now = new Date();
						var jsDate = now.getDate()+'-'+(now.getMonth()+1)+'-'+now.getFullYear();
                        
						var logo = 'data:image/png;base64,';
						
						doc.pageMargins = [20,100,20,60];
						
						doc.defaultStyle.fontSize = 8;
					
						doc.styles.tableHeader.fontSize = 9;
						
						doc['header']=(function() {
							return {
								columns: [
									
									{
										image: logo,
										height: 45,
                                        width: 400
									},
									{
										alignment: 'right',
										fontSize: 14,
										text: 'Online\nFeedback Report'
									}
								],
								margin: 20,
                                padding: 10
							}
						});
                        doc['body']=(function(){
                            return {
                                text: "No of students given feedback-"
                            }
                        });
						doc['footer']=(function(page, pages) {
							return {
								columns: [
									{
										alignment: 'left',
										text: ['Created on: ', { text: jsDate.toString() }]
									},
                                    {
                                        alignment: 'center',
                                        text: "Website: https://www.prakasamec.com/ \n Mail: pec@prakasamec.com"
                                    },
									{
										alignment: 'right',
										text: ['Page ', { text: page.toString() },	' of ',	{ text: pages.toString() }]
									}
								],
								margin: 20
							}
						});
						
						var objLayout = {};
						objLayout['hLineWidth'] = function(i) { return .5; };
						objLayout['vLineWidth'] = function(i) { return .5; };
						objLayout['hLineColor'] = function(i) { return '#aaa'; };
						objLayout['vLineColor'] = function(i) { return '#aaa'; };
						objLayout['paddingLeft'] = function(i) { return 4; };
						objLayout['paddingRight'] = function(i) { return 4; };
						doc.content[0].layout = objLayout;
				}
				}]
            } );
        } 
</script>